import React from 'react';

import { SpinnerOverlay, SpinnerContainer } from './with-spinner.styles';


const WithSpinner = wrapedComponent => ({isLoading , ...otherProps}) => {
    return isLoading ? (
        <SpinnerOverlay >
            <SpinnerContainer/>
        </SpinnerOverlay>
    ):(
        <wrapedComponent {...otherProps} />
    );
};

export default WithSpinner;
